export function position(up, down) {
    return {
        type: 'POSITION',
        up,
        down,
    }
}
export function timerID(id) {
    return {
        type: 'TIMER',
        id
    }
}
export function selectCharacter(char) {
    console.log(char)
    return {
        type: 'CHAR',
        data: char
    }
}
